            ws.Cell(row, COL_COLineUnitPrice).Value = fgs.COLineUnitPrice; //42.1234;
            ws.Cell(row, COL_COCurrCode).Value = fgs.COCurrCode; //"USD";
            ws.Cell(row, COL_COFXRate).Value = fgs.COFXRate;
        }
        row += 1;
    }
