            if (nights < 10) {
                price *= 0.90;
            }
            else if (nights > 15) {
                price *= 0.80;
            }
            else {
                price *= 0.85;
            }
        }

        if (rating == "positive") {
            price *= 1.25;
        }
        else {
            price *= 0.90;
        }    
    }

