#include <iostream>
#include <string>

using namespace std;

int main() {
    int days;
    cin >> days;

    int nights = days - 1;

    string type, rating;
    cin >> type >> rating;

    double price =
        nights > 0 ?
        ((type == "room for one person" ? 18.00 :
            type == "apartment" ? 25.00 * (nights < 10 ? 0.70 : nights > 15 ? 0.50 : 0.65) :
            35.00 * (nights < 10 ? 0.90 : nights > 15 ? 0.80 : 0.85)) * (rating == "positive" ? 1.25 : 0.90)) : 0;

    printf("%.2f\n", price * nights);

    return 0;
}

