#include <iostream>
#include <vector>

using namespace std;

vector<int> par, sz; //   par( ), sz(  )
vector<int> gm; // gm[i] = j ,      ,  i- , -  x

int get_par(int v) { // get_par(v)   ,    v- 
    if (par[v] == v) { //      ,   ,    
        return v; //   
    }
    //     (   ),     v       v
    return par[v] = get_par(par[v]);
}

void unite(int a, int b) { // ,  2 
    a = get_par(a); //   ,    a- 
    b = get_par(b); //   ,    b- 
    if (a == b) return; //    ,   ,    
    if (sz[a] > sz[b]) //   ,    a,   ,    b,     a  b
        swap(a, b);
    par[a] = b; //  a  b
    sz[b] += sz[a]; //      b      a
    gm[b] = max(gm[b], gm[a]); //   ,  b-  -           a- 
}

void solve() {
    int n;
    cin >> n; //  -   
    vector<int> ans(n, -1); // ans[i] = j ,  i-    j- 
    vector<bool> free(n, true); // free[i] = true,  i-  
                                // free[i] = false,  i-  
    sz.resize(n, 1); //      1,       1- 
    par.resize(n); 
    //      1- ,   ,     
    for (int i = 0; i < n; ++i) {
        par[i] = i;
    }
    gm.resize(n); //      1- ,       
    for (int i = 0; i < n; ++i) {
        gm[i] = i;
    }
    for (int i = 0; i < n; ++i) {
        int idx;
        cin >> idx; //   ,     
        idx--; //     1,        1,   ,     0
        if (free[idx]) { //     ,      (,   )
            ans[i] = idx; // ,  i-    idx- 
        } else if (gm[get_par(idx)] < n - 1) { //  ,  idx-    (n - 1)- ,     1-    
            ans[i] = gm[get_par(idx)] + 1;
        } else if (free[0]) { //  ,  idx-    (n - 1)- ,  0-  ,       
            ans[i] = 0;
        } else { //  ,  idx-    (n - 1)- ,  0-  ,     1-   ,  0- 
            ans[i] = gm[get_par(0)] + 1;
        }
        free[ans[i]] = false; // ,  ,    i-   
        if (ans[i] - 1 >= 0 && !free[ans[i] - 1]) { //    ,    ,   ,     " " (      n - 1),   ans[i]-    .
            unite(ans[i] - 1, ans[i]);
        }
        if (ans[i] + 1 < n && !free[ans[i] + 1]) { //    ,    ,   ,     " " (      0),   ans[i]-    .
            unite(ans[i], ans[i] + 1);
        }
    }
    for (auto el : ans) { //  
        cout << el + 1 <<  ' '; //      1,        1,     0
    }
}

int main() {
    solve();
    return 0;
}

