    int n;
    cin >> n;
    vector<int> v(n);
    vector<pair<int, int> > compressed;
    for(int i = 0; i < n; i++) {
        cin >> v[i];
        compressed.push_back(make_pair(v[i], i));
    }
    sort(compressed.begin(), compressed.end());
    vector<int> tmp;
    for(int i = 0; i < n; i++) {
        tmp.push_back(compressed[i].second);
    }
    reverse(tmp.begin(), tmp.end());
    build(1, 0, n);
    vector<ll> smaller;
    for(int i = 0; i < n; i++) {
        update(1, 0, n, tmp[i]);
        smaller.push_back(query(1, 0, n, 0, tmp[i] - 1));
    }
    build(1, 0, n);
    vector<ll> bigger;
    for(int i = n - 1; i >= 0; i--) {
        update(1, 0, n, tmp[i]);
        bigger.push_back(query(1, 0, n, tmp[i] + 1, n));
    }
    reverse(bigger.begin(), bigger.end());
    
    ll res = 0;
    for(int i = 0; i < n; i++) {
        res += bigger[i] * smaller[i];
    }
